import random


def select_10_percent(lst):
    n = len(lst)
    num_to_select = int(n * 0.1)
    selected = []

    for i in range(n):
        prob = (i + 1) / n
        if random.random() <= prob and len(selected) < num_to_select:
            selected.append(lst[i])

    return selected


